портрет, который он недавно вырезал из иллюстрированного журнала и вставил в красивую золоченую рамку. На портрете была изображена дама в меховой шляпе и боа, она сидела очень прямо и протягивала зрителю тяжелую меховую муфту, в которой целиком исчезала ее рука. Затем взгляд Грегора устремился в окно, и пасмурная погода – слышно было, как по жести подоконника стучат капли дождя – привела его и вовсе в грустное настроение. «Хорошо бы еще немного поспать и забыть всю эту чепуху», – подумал он, но это было совершенно неосуществимо, он привык спать на правом боку, а в теперешнем своем</p>','','',''),(2,0,'',1,0,'','2012-12-05 23:13:42','2012-12-05 23:15:21',1,1,1,'default','','0.00','0.00','100.000000','100.00',0,'0.0000','thumb_015e2bfe325ca56e1af2d963f1298fbb.jpg','015e2bfe325ca56e1af2d963f1298fbb.jpg','full_015e2bfe325ca56e1af2d963f1298fbb.jpg',0,0,3,0.00,0,0,1,'0.0000',0,0,0,1,'','','','','','','','Квадратный пуф','','','','','',''),(3,0,'',1,0,'','2012-12-05 23:13:51','2012-12-05 23:16:00',1,1,1,'default','','0.00','0.00','100.000000','100.00',0,'0.0000','thumb_57592065f22d1fb0b4ae29100fa30c0b.jpg','57592065f22d1fb0b4ae29100fa30c0b.jpg','full_57592065f22d1fb0b4ae29100fa30c0b.jpg',0,0,3,0.00,0,0,4,'0.0000',0,0,0,1,'','','','','','','','Вишенка','','','','','',''),(13,0,'',1,0,'','2012-12-05 23:19:30','2012-12-05 23:19:30',1,1,1,'default','','0.00','0.00','120.000000','120.00',0,'0.0000','thumb_7b37aa9617f9a9c77f9a157212e8de75.jpg','7b37aa9617f9a9c77f9a157212e8de75.jpg','full_7b37aa9617f9a9c77f9a157212e8de75.jpg',0,0,3,0.00,0,0,2,'0.0000',0,0,0,1,'','','','','','','','Сердце','','','','','',''),(11,0,'',1,0,'','2012-12-05 23:18:25','2012-12-05 23:18:25',1,1,1,'default','','0.00','0.00','200.000000','200.00',0,'0.0000','thumb_d94b84d8edce08095643526ea5fd9992.jpg','d94b84d8edce08095643526ea5fd9992.jpg','full_d94b84d8edce08095643526ea5fd9992.jpg',0,0,3,0.00,0,0,0,'0.0000',0,0,0,1,'','','','','','','','Феррари','','','','','',''),(12,0,'',1,0,'','2012-12-05 23:18:54','20